const items = $input.all();

for (const item of items) {
  const original = item.json;

  // Build Order #
  const orderDate = original["Order Date"]; // MM/DD/YYYY
  const [month, day, year] = orderDate.split("/");

  const yymmdd =
    year.slice(-2) +
    month.padStart(2, "0") +
    day.padStart(2, "0");

  const orderNumber = `PO${yymmdd}-${original.row_number - 1}`;

  // Reconstruct object in correct column order
  item.json = {
    row_number: original.row_number,
    "Order #": orderNumber,
    "Order Date": original["Order Date"],
    ...Object.fromEntries(
      Object.entries(original).filter(
        ([key]) => !["row_number", "Order Date"].includes(key)
      )
    )
  };
}

return items;

